==========================================================================================*/


export default {
    setDbpmSearchQuery({ commit }, query) {
        commit('SET_DBPM_SEARCH_QUERY', query)
    },
    updateDbpmFilter({ commit }, filterName) {
        commit('UPDATE_DBPM_FILTER', filterName)
    },
    toggleIsDbpmStarred({ commit }, payload) {
        commit('TOGGLE_IS_DBPM_STARRED', payload);
    },
    moveDbpmsTo({ commit }, payload) {
        commit('MOVE_DBPMS_TO', payload);
    },
    updateDbpmUnread({ commit }, payload) {
        commit('UPDATE_DBPM_UNREAD', payload);
    },
    addLabelToDbpms({ commit }, payload) {
        commit('ADD_LABEL_TO_DBPMS', payload);
    },
    updateDbpmLabels({ commit }, payload) {
        commit('UPDATE_DBPM_LABELS', payload);
    },
}
